import React from 'react';
import './TopBar.css';
import resume from './Masters_Thesis.pdf';

interface TopBarProps {
    onButtonClick: (textContent: string) => void;
    textContent: string;
}

function TopBar({ onButtonClick, textContent }: TopBarProps) {
    return (
        <div className="topnav">
            <div className='socials'>
                <a title='github' href="https://github.com/delyan-kirov/">
                    <img src={require("./github.png")} alt="github" style={{ width: '40px', height: '40px' }} /></a>
                <a title='email' href="#news">
                    <img src={require("./email.png")} alt="email" style={{ width: '40px', height: '40px' }} /></a>
                <a title='linkedin' href="https://www.linkedin.com/in/delyan-kirov-7132401a6">
                    <img src={require("./linkedin.png")} alt="linkdin" style={{ width: '40px', height: '40px' }} /></a>
                <a title="resume" href={resume} target="_blank" download="resume.html">
                    <img src={require("./resume.png")} alt="resume" style={{ width: '40px', height: '40px' }} /></a>
            </div>
        </div>
    );
}

export default TopBar;
